import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class ShoppingList extends React.Component{
    render(){
        return (
            <div className = "shopping-list">
                <h1>Shopping List for {this.props.name}</h1>
                <u1>
                    <li>Instagram</li>
                    <li>WhatsApp</li>
                    <li>Oculus</li>
                </u1>
            </div>
        );
    }
}
